import axios from "axios";

const API_BASE = "http://localhost:8000/api";

export const fetchRandomSample = async (rows, tokens) => {
  const res = await axios.get(`${API_BASE}/random_sample`, {
    params: { rows, tokens }
  });
  return res.data.data;
};
